import React from "react";
import family from "../../../assets/cover/Family.jpg";
import FirstConvo from "./FirstConvo";
import LongConvo from "./LongConvo";
import SealTheDeal from "./SealTheDeal";
import FirstDate from "./FirstDate";

function About() {
  return (
    <section id="about-me" class="bio">
      <h2>Welcome to our Wishing Well!</h2>
      <img
        className="family"
        src={family}
        alt="Joseph Cooper with his wife Erin and their two dogs, Rosie and Rango."
      />
      <p>
        Erin and I are so very thankful that you have come out today to support
        us. We don't expect anything from you just your physical presence here
        today is all that we ask for. If you would like to donate to our wishing
        well you're welcome to click any of the links above. Donations will be
        used to help fund our honeymoon in Hawaii. Also maybe if some billionair
        comes accross my website it will be used to buy a nice fishing boat too...
      </p>
      <br></br>
      <br></br>
      <h2>
        While you're here please feel free to read a few stories below about how
        we fell in love.
      </h2>

      <br></br>
      <div class="info">
        <FirstConvo />
        <LongConvo />
        <SealTheDeal />
        <FirstDate />

      </div>
    </section>
  );
}

export default About;
